import React, { Component } from 'react';

class Header extends Component {

    render (){
        return (
            <div className="header-container">
                <span id="name">Samuel Wright</span>
                <br/>
                <span id="title">SOFTWARE </span>
                <span id="log"></span>
                <span id='glyph'> |</span>
            </div>
        )
    }
}

export default Header;
